import React from 'react'
import { withStyles } from '@material-ui/core/styles'

const styles = () => ({
  root: {
    height: '50vh',
    backgroundColor: 'linear-gradient(135deg, #6fbeff 0%,#183a90 100%)',
  }
})

const Intro = (props) => (
  <div className={props.classes.root}>
    HourTech Intro here
  </div>
)

export default (withStyles)(styles)(Intro)
